/* Procedure structure for procedure `lis_actividades` */

DELIMITER $$

/*!50003 CREATE DEFINER=`admin`@`127.0.0.1` PROCEDURE `lis_actividades`(ope VARCHAR(3))
BEGIN
	if ope='LIS' THEN
		  SELECT 
		    ac.`idactv`,
		    ac.`codactv`,
		    ac.`fecactv`,
		    a.`carani`,
		    c.nomcat,
		    act.`nomact`,
		    ta.`nomtia`,
		    ac.`pesactv`,
		    m.`nomtimed`,
		    ac.`canmedi`,
		    ac.`premedi` 
		  FROM
		    actividades ac 
		    JOIN animales a 
		      ON ac.idani = a.`idani` 
		     join categorias c
		     on a.idcat=c.idcat
		    JOIN tipoactividad ta 
		      ON ac.idtia = ta.`idtia` 
		    JOIN actividad act 
		      ON ta.`idact` = act.`idact` 
		    JOIN tipomedicacion m 
		      ON ac.`idtimed` = m.`idtimed` ORDER BY ac.codactv;
      ELSEIF ope>0 THEN
      		  SELECT 
		    ac.`idactv`,
		    ac.`codactv`,
		    ac.`fecactv`,
		    act.idact,
		    ta.idtia,
		    a.idani,
		    a.`carani`,
		    ac.`pesactv`,
		    m.`nomtimed`,
		    m.`idtimed`,
		    ac.`canmedi`,
		    ac.`premedi`,
		    act.nomact,
		    ta.nomtia
		  FROM
		    actividades ac 
		    JOIN animales a 
		      ON ac.idani = a.`idani` 
		     JOIN categorias c
		     ON a.idcat=c.idcat
		    JOIN tipoactividad ta 
		      ON ac.idtia = ta.`idtia` 
		    JOIN actividad act 
		      ON ta.`idact` = act.`idact` 
		    JOIN tipomedicacion m 
		      ON ac.`idtimed` = m.`idtimed` where ac.codactv=ope;
      
      
      END IF;
      
END */$$
DELIMITER ;

